import styled from 'styled-components';

const Section = styled.section`
  padding: 4rem 0;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
`;

const Container = styled.div`
  text-align: center;
  max-width: 1440px;
  margin: auto;
`;

const Title = styled.h1`
  font-size: 3rem;
  font-weight: 800;
  margin-bottom: 1.5rem;
  color: white;

  @media (min-width: 1024px) {
    font-size: 4rem;
  }
`;

const Text = styled.p`
  font-size: 1rem;
  margin: 1rem 0;
  color: #e5e7eb;
  text-align: left;

  @media (min-width: 1024px) {
    font-size: 1.25rem;
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: 1fr;
  gap: 2.5rem;
  margin-top: 2rem;

  @media (min-width: 768px) {
    grid-template-columns: repeat(2, 1fr);
  }

  @media (min-width: 1024px) {
    grid-template-columns: repeat(4, 1fr);
  }
`;

const Card = styled.div`
  background: #1f2937;
  padding: 1.5rem;
  border-radius: 0.5rem;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
  text-align: left;
  border: 1px solid #374151;
  transition: transform 0.3s;

  &:hover {
    transform: scale(1.05);
  }
`;

const CardTitle = styled.h3`
  font-size: 1.25rem;
  font-weight: 600;
  margin-bottom: 1rem;
  background-image: linear-gradient(to right, cyan, rgb(180, 191, 255));
  color: transparent;
  -webkit-background-clip: text;
  background-clip: text;
`;

const CardList = styled.ul`
  list-style-type: disc;
  padding-left: 1rem;
`;

const CardListItem = styled.li`
  margin-bottom: 0.5rem;
`;

const Roadmap = () => {
  return (
    <Section id="roadmap">
      <Container>
        <Title>Roadmap</Title>
        <Text>Step right up and meet Kendrick the Llama, the ultimate llama-themed token in crypto!</Text>
        <Text>Buy $LLAMA to join an exclusive herd and unlock access to members-only community giveaways and airdrops.</Text>
        <Grid>
          <Card>
            <CardTitle>Phase 1: Launch</CardTitle>
            <CardList>
              <CardListItem>Website Launch</CardListItem>
              <CardListItem>Community Building</CardListItem>
              <CardListItem>Whitepaper Release</CardListItem>
            </CardList>
          </Card>
          <Card>
            <CardTitle>Phase 2: Growth</CardTitle>
            <CardList>
              <CardListItem>Exchange Listings</CardListItem>
              <CardListItem>Marketing Campaigns</CardListItem>
              <CardListItem>Partnerships</CardListItem>
            </CardList>
          </Card>
          <Card>
            <CardTitle>Phase 3: Expansion</CardTitle>
            <CardList>
              <CardListItem>Staking Platform</CardListItem>
              <CardListItem>NFT Marketplace</CardListItem>
              <CardListItem>Global Outreach</CardListItem>
            </CardList>
          </Card>
          <Card>
            <CardTitle>Phase 4: Future Plans</CardTitle>
            <CardList>
              <CardListItem>Metaverse Integration</CardListItem>
              <CardListItem>Further Development</CardListItem>
              <CardListItem>Community Voting</CardListItem>
            </CardList>
          </Card>
        </Grid>
      </Container>
    </Section>
  );
};

export default Roadmap;
